INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 40011, 2, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 1, 125801, "リリ", 1, 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 40011, 2, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 2, 126001, "クリア", 1, 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 40011, 2, 323, "んーと。\nこれ、あげる。\nはい", 0, 3, 126101, "プレシア", 1, 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 40011, 2, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 4, 125801, "リリ", 2, 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 40011, 2, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 5, 126001, "クリア", 2, 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 40011, 2, 326, "お兄。\nきてくれて、うれしい", 0, 6, 126101, "プレシア", 2, 24001);
